func (stateStore) doNotImplement() {}

var _ StateStore = stateStore{}

func NewStateStore(db ormtable.Schema) (StateStore, error) {
	automationTable, err := NewAutomationTable(db)
	if err != nil {
		return nil, err
	}

	timeBasedTriggerTable, err := NewTimeBasedTriggerTable(db)
	if err != nil {
		return nil, err
	}

	return stateStore{
		automationTable,
		timeBasedTriggerTable,
	}, nil
}
